import './Navbar.css';
import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import logo from './images/health-icon.png'; 
import { useRole } from './Context'; 

export default function Navbar() {
    const [isOpen, setIsOpen] = useState(false);
    const { role } = useRole(); 
    console.log("Role in Navbar:", role); // Debugging line to check the role

    const toggleNav = () => {
        setIsOpen(!isOpen); 
    };

    const closeNav = () => {
        setIsOpen(false);
    };

    return (
        <>
            <div className="hamburger" onClick={toggleNav}>
                <span></span>
                <span></span>
                <span></span>
            </div>

            <nav className={`nav ${isOpen ? 'open' : ''}`}>
                <div className='header'>
                    <img src={logo} className="logo" alt="Logo" />
                    <div className="site-title">Health Portal</div>
                </div>
                <ul>
                    <li>
                        <Link to='/Messages>' onClick={closeNav}>Messages</Link>
                    </li>
                    <li>
                        <Link to='/Appointments>' onClick={closeNav}>Appointments</Link>
                    </li>
                    {role === 'doctor' &&
                    <li>
                        <Link to='/HealthRecords>' onClick={closeNav}>Health Records</Link>
                    </li>
                    }
                </ul>
            </nav>
        </>
    );
}
